# Регулярное выражение для поиска URL, заканчивающихся расширением файла
regex_pattern = r"https?://demogamesfree\.pragmaticplay\.net/[\w/.-]+\.\w+"
# regex_pattern = r"https?://app\.lighter\.xyz[^\s]*"
# regex_pattern = r"http://localhost:9999/[^\s]+(?:\s[^\s]+)?\.[^\s]+"
# regex_pattern = r"http://127\.0\.0\.1:5500/[^[\r\n]+"
